import React, { Component } from 'react'
import NavBar from './Components/NavBar'
import NewsContainer from './Components/NewsContainer'
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
        <NavBar/> 
        <Switch>
          <Route exact path="/"><NewsContainer key="general" pageSize={5} country="in" category="general"/></Route> 
          <Route exact path="/business"><NewsContainer key="business" pageSize={5} country="in" category="business"/></Route> 
          <Route exact path="/entertainment"><NewsContainer key="entertainment" pageSize={5} country="in" category="entertainment"/></Route> 
          <Route exact path="/general"><NewsContainer key="general" pageSize={5} country="in" category="general"/></Route> 
          <Route exact path="/health"><NewsContainer key="health" pageSize={5} country="in" category="health"/></Route> 
          <Route exact path="/science"><NewsContainer key="science" pageSize={5} country="in" category="science"/></Route> 
          <Route exact path="/sports"><NewsContainer key="sports" pageSize={5} country="in" category="sports"/></Route> 
          <Route exact path="/technology"><NewsContainer key="technology" pageSize={5} country="in" category="technology"/></Route> 
        </Switch>
        </Router>
      </div>
    )
  }
}
